INSERT INTO necs_article VALUES('47','2','购物流程','<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span><strong><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\"> </span></span><span style=\"font-size: xx-large; \"><span style=\"color: rgb(255, 0, 0); \">退货须知</span></span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">1.不影响二次销售；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">2.退货款取下单日和退货日其中较低的计算；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">3.退货款时间按公司收到返货，检验无问题第一时间退款，不</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">&nbsp; &nbsp;能与新订单相互抵销；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">4.返款手续费客户自行承担；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">5.需要本公司定货商品不予退款；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">6.特价、促销等类似产品不予退货；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">7.退货时间 按公司收到日期为准 上限10天 延期不予退货；</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">8.退货运费公司不予承担，免运费需退还运费；</span></span></p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\"><br />\r\n</span></span><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">返修</span></span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: xx-large;\">公司只承担货站运费 售后发出公司不承担运费</span></span><img alt=\"\" width=\"816\" height=\"37\" src=\"/images/upload/Image/-2.jpg\" /></p>\r\n<p><img alt=\"\" width=\"411\" height=\"359\" src=\"/images/upload/Image/0.jpg\" /></p>\r\n<p><img alt=\"\" width=\"816\" height=\"37\" src=\"/images/upload/Image/-1.jpg\" /></p>\r\n<p><span style=\"color: #666666; font-size: 9pt\">1、<span style=\"font: 7pt \'Times New Roman\'\">&nbsp;&nbsp; </span></span><span style=\"background: white; color: #666666; font-size: 9pt\">点击页面顶部</span><span style=\"background: white; color: #666666; font-size: 9pt\">&ldquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">免费注册</span><span style=\"background: white; color: #666666; font-size: 9pt\">&ldquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">，进入注册页面；</span></p>\r\n<p><span style=\"background: white; color: #666666; font-size: 9pt\"><img alt=\"\" width=\"886\" height=\"108\" src=\"/images/upload/Image/1(3).jpg\" /></span></p>\r\n<p><span style=\"background: white; color: #666666; font-size: 9pt\">&nbsp;</span></p>\r\n<div style=\"text-align: left; line-height: 13.5pt; text-indent: -18pt; margin: 0cm 0cm 0pt 18pt; background: white\" align=\"left\"><span style=\"color: #666666; font-size: 9pt\">2、<span style=\"font: 7pt \'Times New Roman\'\">&nbsp;&nbsp; </span></span><span style=\"background: white; color: #666666; font-size: 9pt\">填写账户名、密码等个人信息进行注册；</span></div>\r\n<div style=\"text-align: left; line-height: 13.5pt; text-indent: -18pt; margin: 0cm 0cm 0pt 18pt; background: white\" align=\"left\"><span style=\"background: white; color: #666666; font-size: 9pt\">3</span><span style=\"background: white; color: #666666; font-size: 9pt\">、选中</span><span style=\"background: white; color: #666666; font-size: 9pt\">&ldquo;</span><span style=\"background: white; color: #666666; font-size: 9pt\">我已阅读并同意《77用户注册协议》</span><span style=\"background: white; color: #666666; font-size: 9pt\">&rdquo;</spa